import React from 'react';
import {
    AppBar,
    Toolbar,
    ListItem,
    IconButton,
    ListItemText,
    Avatar,
    Divider,
    List,
    Typography,
    Box
} from '@material-ui/core';
import {
    ArrowBack,
    AssignmentInd,
    Home,
    Apps,
    ContactMail,


} from '@material-ui/icons';


const Navbar = () => {

        return (
        <header className="toolbar">
            <nav className="toolbar_navigation">
                <div></div>
                <div className="toolbar_logo"><a href="/">The Logo</a></div>

                <div className="toolbar_navigation-item"></div>
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/">My Courses</a></li>
                </ul>

            </nav>
        </header>

    );


}

export default Navbar;
